import React from "react";
import { ArrowUpRight } from "@phosphor-icons/react";

export default function Link(props) {
    return (
        <div className="d-flex justify-between bg-white rounded">
            <a href="">
                <div className="d-flex justify-center items-center bg-zinc-900 rounded">
                </div>

                <div>
                    {props.title}
                </div>

                <div>
                    <ArrowUpRight size={24} />
                </div>
            </a>
        </div>
    )
}
